import React from 'react';
import './Header.css'; // Import CSS file for styling (if needed)
import profile from '../images/profile.jpg'; // Ensure the path to your image is correct
import notification from '../svg/notification.svg';
import dashboard from '../images/dashboard.jpg'

function Header() {
    return (
        <header className="header">
            <div> <a href="/dashboard">
                <img src={dashboard} alt="Dashboard" className="dashboard-picture" />
            </a></div>
            <nav className="nav">
                <ul>
                    <li>
                        <a href="/notification">
                            <img src={notification} alt="Notification" className="notification-picture" />
                        </a>
                        <a href="/profile">
                            <img src={profile} alt="Profile" className="profile-picture" />
                        </a>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
